$('.special-action1, .special-action2').html(skull);
let skull2 = skull;
skull2 = skull2.split('');

let randomizerID;

$('.special-action1').on('mouseenter', function() {
	randomizerID = setInterval(function() {
		$('.special-action1').css('color', 'rgba(' + Math.random()*255 + ', ' + Math.random()*255 + ', ' + Math.random()*255 + ', ' + Math.random() + ')');
	}, 500);
});

$('.special-action2').on('mouseenter', function() {
	randomizerID = setInterval(function() {
		$('.special-action2').css('color', 'rgba(' + Math.random()*255 + ', ' + Math.random()*255 + ', ' + Math.random()*255 + ', ' + Math.random() + ')');
	}, 500);
});

$('.special-action1').on('mouseleave', function() {
	clearInterval(randomizerID)
});

$('.special-action2').on('mouseleave', function() {
	clearInterval(randomizerID)
});

